INSERT INTO `tv_stats` VALUES (1,1,1,'Winter Is Coming',61,'Tim Van Patten','David Benioff, D. B. Weiss','17-Apr-2011',2.22,'Ramin Djawadi','Alik Sakharov','Oral Norrie Ottey',8.9,100,9.1,'March 2, 2010','Second half of 2010','A Game of Thrones','North of the Seven Kingdoms of Westeros, Night\'s Watch soldiers are attacked by supernatural White Walkers. One soldier escapes but is captured at Castle Winterfell. Eddard \"Ned\" Stark, Warden of the North, executes him for desertion. Later, six orphaned dire wolf pups are found and one given to each Stark sibling, including Ned\'s bastard son, Jon Snow. In King\'s Landing, the Seven Kingdoms capital, Jon Arryn, the Hand of the King, dies suddenly. King Robert Baratheon, Ned\'s old friend, travels to Winterfell to recruit Ned and propose a marriage between his heir Joffrey and Ned\'s daughter, Sansa. Lysa Arryn, Jon\'s widow, sends her sister (Ned\'s wife), Catelyn, a letter claiming the Lannisters, Queen Cersei\'s family, murdered Arryn. Catelyn believes the Lannisters are now plotting against King Robert. Ned\'s young son, Brandon, climbs a tall tower and witnesses Cersei and her twin brother, Jaime Lannister, inside having sex. To hide their incest, Jaime pushes Bran from the high window. Across the Narrow Sea in Essos, exiled Prince Viserys Targaryen forces his sister, Daenerys, to marry the Dothraki warlord, Drogo, in exchange for an army to conquer Westeros and reclaim the Iron Throne. The ancient Targaryens once commanded dragons, and Daenerys is given three fossilized dragon eggs as a wedding gift.'),(1,2,2,'The Kingsroad',55,'Tim Van Patten','David Benioff, D. B. Weiss','24-Apr-2011',2.2,'Ramin Djawadi','Alik Sakharov','Oral Norrie Ottey',8.6,100,8.9,'March 2, 2010','Second half of 2010','A Game of Thrones','Ned, the new Hand of the King, travels to King\'s Landing accompanied by his daughters, Sansa and Arya. Catelyn remains at Winterfell to care for the still unconscious Bran. An assassin attacks Bran, but Catelyn fends him off and Bran\'s direwolf, Summer, kills him. Catelyn suspects the Lannisters were behind the attack. Ned\'s illegitimate son, Jon, heads north with his uncle, Benjen Stark, to join the Night\'s Watch, the protectors of the Wall, a massive ice structure that keeps the Wildling tribes and the mythical White Walkers from civilized Westeros. Before departing, Jon gave tomboy Arya a thin sword she names, \"Needle\". Queen Cersei\'s younger brother, Tyrion Lannister, a dwarf also known as \"The Imp,\" accompanies Jon to the Wall. Along the Kingsroad on their way towards King\'s Landing, Prince Joffrey threatens Arya\'s young commoner friend, later having him killed. Nymeria, Arya\'s direwolf, defends her, biting Joffrey. Cersei demands that Robert have the wolf killed, but Arya releases Nymeria to the wild. Sansa\'s direwolf, Lady, is killed instead. In Winterfell, Brandon awakens, remembering nothing about his fall. Meanwhile, Daenerys is befriended by Ser Jorah Mormont, a disgraced knight, while she focuses on learning how to please Drogo.'),(1,3,3,'Lord Snow',57,'Brian Kirk','David Benioff, D. B. Weiss','1-May-2011',2.44,'Ramin Djawadi','Marco Pontecorvo','Frances Parker',8.5,81,8.7,'March 2, 2010','Second half of 2010','A Game of Thrones','Ned attends the King\'s Small Council and learns Westeros has been poorly managed and is deeply in debt. Catelyn travels to King\'s Landing to covertly warn her husband about the assassination attempt, but she is intercepted by her childhood friend, Councillor Petyr \"Littlefinger\" Baelish. Bran learns he will never walk again and remains unable to remember the events leading to his fall. Jon struggles to adapt to life on the Wall. The once elite Night\'s Watch now recruits many low-born and/or convicted criminals who are unimpressed by Jon\'s bloodline. Lord Commander Mormont asks Tyrion to plead with the King to send more recruits to the Night\'s Watch. Daenerys, now pregnant, stands up to her brother, Viserys, threatening him if he ever abuses her again.'),(1,4,4,'Cripples, Bastards, and Broken Things',55,'Brian Kirk','Bryan Cogman','8-May-2011',2.45,'Ramin Djawadi','Marco Pontecorvo','Frances Parker',8.6,100,9.1,'March 2, 2010','Second half of 2010','A Game of Thrones','While returning to King\'s Landing, Tyrion stops at Winterfell where he presents the Starks a saddle design that will allow the paraplegic Bran to ride a horse. Ned secretly investigates Jon Arryn\'s death. In the process, he discovers one of King Robert\'s illegitimate children, Gendry, an armorer. Robert and his guests attend a tournament honoring Ned, which Ned considers an extravagance. Jon takes measures to protect Samwell Tarly, an awkward and friendless Night\'s Watch recruit, from the other Watchmen\'s abuse. A frustrated Viserys clashes with his newly-empowered sister. Sansa dreams of one day becoming queen, while Arya envisions a far different future. At a roadside tavern, Catelyn, who is Lord Hoster Tully\'s daughter, unexpectedly encounters Tyrion Lannister. She rallies her father\'s Riverrun allies to arrest Tyrion for conspiring to murder her son.'),(1,5,5,'The Wolf and the Lion',54,'Brian Kirk','David Benioff, D. B. Weiss','15-May-2011',2.58,'Ramin Djawadi','Marco Pontecorvo','Frances Parker',9,95,9,'March 2, 2010','Second half of 2010','A Game of Thrones','King Robert\'s eunuch spy, Varys, has uncovered that Daenerys Targaryen is pregnant. Ned rejects Robert\'s plan to assassinate her, considering Daenerys a non-threat. He resigns in protest as Robert\'s Hand, angering the king. Catelyn and her prisoner, Tyrion, arrive at her sister Lysa Arryn\'s fortress home in the Eyrie. News of Tyrion\'s capture reaches King\'s Landing where Jaime Lannister, the Queen\'s twin brother, demands answers from Ned. A vengeful Jaime orders Ned\'s men killed and fights Ned until Jaime\'s man stabs Ned in the leg from behind, leaving him wounded.'),(1,6,6,'A Golden Crown',52,'Daniel Minahan','Jane Espenson, David Benioff, D. B. Weiss','22-May-2011',2.44,'Ramin Djawadi','Matthew Jensen','Martin Nicholson',9.1,100,9.2,'March 2, 2010','Second half of 2010','A Game of Thrones','King Robert reappoints Ned as Hand and tasks him with running affairs until Robert returns from hunting. Villagers from Riverrun arrive with news of atrocities committed by raiders, who Ned deduces were led by Ser Gregor Clegane, a Lannister retainer. Ned sentences Ser Gregor to death and summons Tywin Lannister to a trial. Ned decides to send Sansa (now reconciled with Joffrey) and Arya back to Winterfell. Ned has discovered that Joffrey and his two siblings are not Robert\'s biological children, and were fathered by Jaime Lannister. Bran, while testing his new saddle, is attacked by rogue Wildings. Robb, Ned\'s oldest son, and Theon, Ned\'s captive ward, whose father, King Balon, was a fallen rebel, rescue him, and the woman Wilding, Osha, is enslaved. In the Vale, Tyrion demands a trial by combat. Lysa chooses Ser Vardis as her champion. The sellsword Bronn volunteers as Tyrion\'s champion. He defeats Vardis and obtains Tyrion\'s release. Meanwhile, Viserys grows impatient and angry waiting for Drogo to fulfill his promise, and he threatens to kill Daenerys\' unborn child. Drogo kills Viserys by pouring molten gold on his head.'),(1,7,7,'You Win or You Die',57,'Daniel Minahan','David Benioff, D. B. Weiss','29-May-2011',2.4,'Ramin Djawadi','Matthew Jensen','Martin Nicholson',9.1,100,9.4,'March 2, 2010','Second half of 2010','A Game of Thrones','In King\'s Landing, Ned confronts Cersei, saying he knows Jaime fathered her children and will inform King Robert. Before he can, Robert is critically wounded while hunting boar. As Robert lies dying, he signs a proclamation naming Ned \"Protector of the Realm,\" until Robert\'s heir can assume the throne. Ned amends the wording to say the king\'s rightful heir. Ned sends word to Stannis, Robert\'s brother, the legal heir to the throne. Ned asks Petyr Baelish to secure the City Watch\'s loyalty. After Robert\'s death, Ned confronts Cersei and Joffrey in the throne room, where Baelish and the City Watch betray Ned and attack his men. At the Wall, Benjen Stark disappears during a foray north of the Wall. Jon and Sam are assigned as stewards, with Jon as Lord Commander Jeor Mormont\'s personal servant. Jon is disappointed he was not chosen as a ranger until Sam points out that Commander Mormont likely intends to groom him for command. The stewards swear their loyalties to the Night\'s Watch. In Essos, King Robert\'s hired assassin is exposed by Ser Jorah before he can poison Daenerys. Drogo vows to conquer the Seven Kingdoms for his unborn son and starts marching towards Westeros.'),(1,8,8,'The Pointy End',58,'Daniel Minahan','George R. R. Martin','5-Jun-2011',2.72,'Ramin Djawadi','Matthew Jensen','Martin Nicholson',8.9,95,8.9,'March 2, 2010','Second half of 2010','A Game of Thrones','Arya escapes the Red Keep after Syrio Forel, her Braavosian sword master, fends off guards sent to arrest her, while Sansa is captured. Robb hears the news and prepares the Northern armies to fight the Lannisters, leaving Bran behind to rule Winterfell. Lysa refuses to fight the Lannisters, and Catelyn leaves to join Robb\'s camp. Tyrion and Bronn are surrounded by Shagga, leader of the Stone Crows tribe. Tyrion convinces them to escort him to his father Tywin Lannister, who will pay them. At the camp, Tywin asks Shagga to help them confront the Starks in exchange for even greater payment. At the Wall, some bodies affected by the White Walkers are found. One awakens as a wight and attack Commander Mormont, but Jon kills it. In Essos, Drogo\'s soldiers begin attacking nearby settlements, enslaving locals in order to sell them to raise money to buy ships to cross the Narrow Sea. Drogo is wounded in a fight. Joffrey appoints his grandfather, Tywin, as Hand of the King. Sansa begs Joffrey to show Ned mercy. Joffrey agrees if Ned publicly recognizes Joffrey\'s claim to the throne and admits to committing treason.'),(1,9,9,'Baelor',56,'Alan Taylor','David Benioff, D. B. Weiss','12-Jun-2011',2.66,'Ramin Djawadi','Alik Sakharov','Frances Parker',9.6,100,9.5,'March 2, 2010','Second half of 2010','A Game of Thrones','The Stark army arrives at the Twins castle; Catelyn persuades Lord Walder Frey to allow them to pass through his land and assist them in exchange for Robb and Arya marrying two of Frey\'s many unattractive offspring in the future. At the Wall, Jeor Mormont gives his family Valyrian steel sword to Jon in gratitude; Maester Aemon reveals to Jon that Aemon is a Targaryen. In Essos, Drogo\'s wound becomes septic and his death imminent. Daenerys asks a mystic slave woman to use blood magic to save him. The woman tells everyone to remain outside the tent until after the spell is cast. Daenerys goes into labor, and Jorah brings her into the tent seeking aid. Robb sacrifices 2,000 soldiers to fight the Lannister army as a diversion so he can move his army and capture Jaime. In a public hearing, Ned confesses to treason and publicly affirms Joffrey is the rightful heir. However, rather than sparing his life as negotiated, the vengeful and increasingly insane Joffrey has him beheaded, while Sansa, Cersei, and other counselors object futilely. Sansa is forced to watch her father die while Arya is nearby in the crowd.'),(1,10,10,'Fire and Blood',52,'Alan Taylor','David Benioff, D. B. Weiss','19-Jun-2011',3.04,'Ramin Djawadi','Alik Sakharov','Frances Parker',9.4,100,9.4,'March 2, 2010','Second half of 2010','A Game of Thrones','The North secedes from the Seven Kingdoms and proclaims Robb as king. With Jaime as the Starks\' prisoner and Robert\'s two brothers, Stannis and Renly, each challenging Joffrey\'s claim to the throne, Tywin appoints Tyrion as acting King\'s Hand, while Tywin fights to defend Joffrey\'s reign. Jon attempts to desert the Night\'s Watch to avenge Ned and join Robb, but his Night\'s Watch brothers convince him to honor his oath. Jon joins an expedition to search for Benjen Stark beyond the Wall. Yoren, a Night\'s Watch recruiter, smuggles Arya out of King\'s Landing disguised as a boy, while Joffrey intends to crown Sansa his queen, despite executing her father. Daenerys\'s baby is born deformed and dead, and Drogo is left in a vegetative state by the witch\'s treacherous magic. Daenerys compassionately ends Drogo\'s life. She places the three dragon eggs on Drogo\'s funeral pyre and sets it afire, also burning the witch alive. Ignoring Jorah\'s pleas, she walks into the flames. When the embers die the following morning, Daenerys is found in the ashes, unharmed, flanked by three newly-hatched baby dragons. Jorah and other witnesses kneel before her.'),(2,1,11,'The North Remembers',52,'Alan Taylor','David Benioff, D. B. Weiss','1-Apr-2012',3.86,'Ramin Djawadi','Kramer Morgenthau','Frances Parker',8.6,100,8.9,'April 19, 2011','Second half of 2011','A Clash of Kings','In King\'s Landing, Tyrion becomes acting Hand of the King, much to Cersei\'s dismay. At Dragonstone, Stannis proclaims allegiance to the priestess Melisandre\'s God of Light and claims the Iron Throne, having revealed Joffrey\'s bastardy. Joffrey orders all King Robert\'s bastards slaughtered. One of King Robert\'s bastards Gendry, along with the disguised Arya, have escaped the city and are being taken to Castle Black. Having won three victories, Robb Stark, who is now proclaimed as the King of the North, offers the Lannisters peace in exchange for the North\'s independence and Sansa\'s and Arya\'s safe return. He sends Theon to gain Balon Greyjoy\'s support, and Catelyn to seek an alliance with Renly Baratheon, who also claims the crown. Beyond the Wall, the Night\'s Watch shelters with Craster and his daughters/wives. In Essos, as her people slowly die in the Red Waste, Daenerys dispatches three riders to conduct reconnaissance.'),(2,2,12,'The Night Lands',53,'Alan Taylor','David Benioff, D. B. Weiss','8-Apr-2012',3.76,'Ramin Djawadi','Kramer Morgenthau','Frances Parker',8.4,89,7.7,'April 19, 2011','Second half of 2011','A Clash of Kings','Returning to Pyke Island after nine years as the Starks\' ward, Theon is reunited with his sister, Yara, and his father, Balon, who despises Theon\'s acquired Northern ways. Balon plots to win back his crown by force. Cersei rejects Robb\'s terms, and Tyrion exiles Slynt, head of the Gold Cloaks, to the Knight\'s Watch, and promotes Bronn to Commander of the Watch. En route to Castle Black, Arya, impersonating a boy, admits her true identity to Gendry. At Craster\'s Keep, north of the Wall, Samwell Tarly is approached by Gilly, one of Craster\'s daughters. Gilly fears for her unborn child if it is a boy; Jon Snow resists helping, despite Sam\'s pleas. In the Red Waste, a horse returns to Daenerys\' camp with its rider\'s severed head in a pouch, a message from her enemies. In Dragonstone, former smuggler Ser Davos Seaworth, who now serves Stannis, recruits the pirate Salladhor Saan and his fleet to Stannis\' side. Stannis attempts to sire a male heir with Melisandre, as his wife, Selyse has failed to produce a son. Jon discovers that Craster sacrifices his sons to the White Walkers; Craster catches him spying and knocks Jon unconscious.'),(2,3,13,'What Is Dead May Never Die',52,'Alik Sakharov','Bryan Cogman','15-Apr-2012',3.77,'Ramin Djawadi','P.J. Dillon','Katie Weiland',8.7,100,8.3,'April 19, 2011','Second half of 2011','A Clash of Kings','Catelyn arrives at Renly\'s camp to negotiate an alliance. The female warrior, Brienne of Tarth, wins the right to join Renly\'s king\'s guard through combat. Renly has recently wed Margaery Tyrell, Loras\'s sister. Renly avoids consummating his and Margaery\'s marriage due to his homosexuality and sexual relationship with Loras. In the Iron Islands, Balon plans an attack on the North, led by Yara. After burning his letter to Robb warning of Balon\'s impending attack, Theon affirms his allegiance to House Greyjoy in a water-based ceremony. In King\'s Landing, Tyrion imprisons Pycelle after determining he is Cersei\'s informant. Tyrion appoints his lover, Shae, as Sansa\'s handmaiden, both to protect Shae and watch Sansa. Beyond the Wall, Craster demands the Night\'s Watchmen leave. Jon discovers that Jeor Mormont has always known about and ignored Craster\'s incestuous crimes in exchange for his men\'s respite at his keep. On the road to the wall, the Night\'s Watch recruits are attacked by Lannister soldiers searching for Gendry. Yoren is killed, and Arya and Gendry are taken prisoner. To protect Gendry, Arya falsely states that a boy the guards have killed was Gendry.'),(2,4,14,'Garden of Bones',50,'David Petrarca','Vanessa Taylor','22-Apr-2012',3.65,'Ramin Djawadi','Martin Kenzie','Katie Weiland',8.6,97,9,'April 19, 2011','Second half of 2011','A Clash of Kings','Robb\'s Army attacks a Lannister Army at Oxcross and claims another victory, meeting a healer girl named Talisa Maegyr in the aftermath. In response, Joffrey publicly abuses Sansa as revenge for Robb\'s victories until Tyrion intervenes. The dwarf sends two prostitutes to the young King to calm his tempers, but Joffrey makes one of them beat the other brutally, thus threatening Tyrion not to interfere with his business. Catelyn attempts to unite the Baratheon brothers against the Lannisters, but Stannis demands Renly\'s loyalty to him as king. Littlefinger visits Catelyn and offers to trade Jaime for her daughters. Davos witnesses Melisandre giving birth to a shadow creature. Tyrion releases Pycelle and dismisses him from the Small Council. When Tyrion discovers Cersei\'s incestuous relationship with their cousin, Lancel, he blackmails Lancel into spying on Cersei, threatening to reveal the relationship to Joffrey. Arya and Gendry are taken to Harrenhal castle as captives. Prisoners are systematically tortured to death until Tywin arrives and demands they be used as labor. Recognizing Arya is a girl, he makes her his servant without knowing her true identity. After an exhausting journey through the desert, Daenerys arrives at the prosperous city of Qarth. Daxos, a member of the Council of Thirteen, persuades fellow councilmen to allow Daenerys and her retinue to enter the city.'),(2,5,15,'The Ghost of Harrenhal',54,'David Petrarca','David Benioff, D. B. Weiss','29-Apr-2012',3.9,'Ramin Djawadi','Martin Kenzie','Katie Weiland',8.6,96,7.6,'April 19, 2011','Second half of 2011','A Clash of Kings','At Harrenhal, Jaqen H\'ghar, one of three caged prisoners Arya previously saved, pledges to kill any three people she chooses to repay his debt to her. Her first choice is the Tickler, the man who mortally tortures the captives. Renly is killed by Melisandre\'s shadowy assassin. Lady Brienne is accused of the murder and Catelyn forces her to flee the camp. Excluding the Tyrells, Renly\'s forces join Stannis. Brienne swears life-long fealty to Catelyn and will protect her daughters. Theon sails from Pyke, and against Yara\'s orders, intends to prove he is a true Ironborn by capturing Winterfell during Robb\'s absence. Lancel tells Tyrion about wildfire, a mass-produced explosive substance hidden in the city\'s dungeons and intended to destroy Stannis\' fleet and army during the impending siege. Tyrion then takes control of the scheme. In the north, the Night\'s Watch arrives at an ancient fortress called the Fist of the First Men. Jeor Mormont allows Jon to join the team led by a veteran named Halfhand, to kill the enemy leader. In Qarth, Daxos proposes marriage to Daenerys in exchange for providing her his wealth to conquer the Seven Kingdoms. Ser Jorah convinces her to instead gain the Westerosi peoples\' support.'),(2,6,16,'The Old Gods and the New',54,'David Nutter','Vanessa Taylor','6-May-2012',3.88,'Ramin Djawadi','Martin Kenzie','Oral Norrie Ottey',8.9,100,9.3,'April 19, 2011','Second half of 2011','A Clash of Kings','Against Cersei\'s wishes, Tyrion sends her and Jaime\'s daughter, Myrcella, to Dorne for protection. Theon captures Winterfell and executes Ser Rodrik Cassel. Osha, the captive Wildling, along with Hodor, helps Bran and Rickon escape. In the aftermath of another battle, Robb reunites with Talisa. At the Fist of the First Men, Jon captures a Wildling named Ygritte, but is separated from his patrol while pursuing her after she escapes. Joffrey\'s presence among the people incites a riot at King\'s Landing, in which he is nearly killed and Sansa almost raped. Tywin allows Littlefinger to seek the Tyrells\' allegiance. At Harrenhal, Arya has H\'ghar kill an officer who is suspicious of her. Robb receives news about Theon\'s treachery and sends men to retake Winterfell. At Qarth, Daenerys works to procure a ship to transport an army to Westeros while keeping Daxos at bay. One of Daenerys\' maids is killed and her dragons stolen.'),(2,7,17,'A Man Without Honor',55,'David Nutter','David Benioff, D. B. Weiss','13-May-2012',3.69,'Ramin Djawadi','Martin Kenzie','Oral Norrie Ottey',8.8,96,8.7,'April 19, 2011','Second half of 2011','A Clash of Kings','Theon and his men pursue Brandon and Rickon. Tywin has Harrenhal searched for his officer\'s killer. Jon recaptures Ygritte, but she escapes again, leading him into a trap. Still shaken from the riot, Sansa is horrified that she has begun menstruating and is now old enough to marry and bear Joffrey\'s children. Cersei warns her to love no one but her children, not even Joffrey. In Robb\'s camp, Jaime\'s failed escape leaves a guard dead and some soldiers seeking retribution. In Qarth, the warlock Pree says he stole Daenerys\' dragons; he offers her the opportunity to reunite with them, then slaughters the Council of Thirteen and establishes Daxos as king. In Winterfell, Theon presents the charred corpses of two farm boys to Maester Luwin, claiming they are Brandon and Rickon.'),(2,8,18,'The Prince of Winterfell',53,'Alan Taylor','David Benioff, D. B. Weiss','20-May-2012',3.86,'Ramin Djawadi','Jonathan Freeman','Frances Parker',8.6,100,8.8,'April 19, 2011','Second half of 2011','A Clash of Kings','Robb learns that Catelyn secretly freed Jaime Lannister, who Brienne is escorting to ransom him in exchange for Sansa and Arya; Robb places his mother under house arrest and sends men to capture Jaime. Robb is attracted to a spirited medic, Talisa Maegyr, a woman from Volantis. Yara arrives at Winterfell and criticizes Theon\'s seizing it, saying it has no strategic value to the Ironborn. He refuses to return to Pyke with her. When Tywin leaves Harrenhal to attack Robb, Arya coerces H\'ghar into helping her, Gendry, and their friend, Hot Pie to escape. In King\'s Landing, Cersei attempts to blackmail Tyrion by abducting Ros, whom the former believes is his secret lover. Joffrey chastises Varys for not having more knowledge of Stark positions, and prepares to lead the attack against Stannis himself. En route to King\'s Landing, Stannis promises to make Davos his Hand of the King. Beyond the Wall, the Wildling leader, \"Rattleshirt\", leads the captured Jon and Halfhand to his king, Mance Rayder. At the Fist of the First Men, the brothers of the Night\'s Watch find a hidden cache of dragonglass weapons, left there by a previous Night\'s Watch brother. In Qarth, Jorah agrees to accompany Daenerys to the House of the Undying to retrieve her dragons. Brandon and Rickon are revealed to be alive and hiding in Winterfell.'),(2,9,19,'Blackwater',54,'Neil Marshall','George R. R. Martin','27-May-2012',3.38,'Ramin Djawadi','Sam McCurdy','Oral Norrie Ottey',9.6,100,9.5,'April 19, 2011','Second half of 2011','A Clash of Kings','Stannis\' fleet assaults King\'s Landing. Sansa plays the game, trying to manipulate Joffrey into leading the attack personally, (in hopes of getting him killed), but Joffrey turns out to be too afraid to fight personally. Leading the defense, Tyrion destroys many attacking ships with wildfire, forcing Stannis to attack on land. Sandor Clegane leads the defense outside the gate, but is defeated and retreats inside, denouncing Joffrey and leaving. Joffrey retreats in fear as Tyrion rallies the Gold Cloaks into fighting with him. Stannis\' forces enter the castle, but Tyrion leads his men behind Stannis\' forces via tunnels and mounts a rearguard attack. Cersei goes to the throne room with Tommen, intending to kill him to save him from being captured. Shae convinces Sansa to hide in her chamber. Sandor Clegane offers to take Sansa to Winterfell, but she refuses to leave. As Tyrion lies wounded and Cersei is about to poison Tommen, Tywin\'s forces, joined by Loras, arrive and force Stannis to retreat.'),(2,10,20,'Valar Morghulis',63,'Alan Taylor','David Benioff, D. B. Weiss','3-Jun-2012',4.2,'Ramin Djawadi','Jonathan Freeman','Frances Parker',9.3,92,9.2,'April 19, 2011','Second half of 2011','A Clash of Kings','Joffrey sets Sansa aside to marry Margaery Tyrell and ally with the Tyrell family. Tyrion fears for his and Shae\'s safety after Tywin is named Hand of the King. Melisandre gives Stannis a new hope. Brienne kills Stark soldiers after they recognize Jaime. Catelyn fails to dissuade Robb from marrying Talisa, breaking his promise to wed Walder Frey\'s daughter. In Qarth, inside the House of the Undying, Daenerys enters a simulacrum of a destroyed Iron Throne room, then is reunited with what appears to be Khal Drogo and their infant son. Knowing it is unreal, she leaves and successfully retrieves her dragons, who fatally burn Pree, who tries to imprison her. She seals Daxos and her traitorous servant inside his empty vault and claims his other possessions, with which Jorah will pay for a small ship. In Winterfell, Theon wants his men to fight Robb\'s army, but they knock him unconscious and leave; Winterfell is torched. Fatally wounded Maester Luwin convinces Osha to escape with Brandon and Rickon to the Wall for Jon\'s protection. After Arya, Hot Pie, and Gendry escape Harrenhal, H\'ghar gives Arya a non-monetary coin he says can be used to find him in Braavos. Before her, he magically changes his face. North of the Wall, Halfhand forces Jon to kill him to prove his loyalty to the Wildlings. An army of White Walkers and dead men surrounds the Fist of the First Men; Sam hides, watching in horror as they pass.'),(3,1,21,'Valar Dohaeris',54,'Daniel Minahan','David Benioff, D. B. Weiss','31-Mar-2013',4.37,'Ramin Djawadi','Jonathan Freeman','Frances Parker',8.6,98,8.3,'April 10, 2012','July–November 2012','A Storm of Swords','After the White Walkers\' attack, the surviving Night\'s Watchmen, including Samwell Tarly and Jeor Mormont, pledge to return to the Wall and warn the Seven Kingdoms. Jon is brought before Mance Rayder, the \"King beyond the Wall\", and pledges his loyalty to the Wildlings. A scarred Tyrion Lannister attempts to negotiate Casterly Rock from Tywin, who offers lesser promises. Margaery Tyrell engages in charitable acts with King\'s Landing orphans. Littlefinger offers to help Sansa Stark escape King\'s Landing. Ros warns Shae to distrust Littlefinger. Davos is rescued by Saan, who wants to break ties with Stannis Baratheon. Davos returns to Dragonstone where he unsuccessfully tries to kill Melisandre and is imprisoned. She blames him for convincing Stannis not to let her join the battle. In Essos, Daenerys Targaryen arrives in Astapor to buy an army of brutally-trained mercenary soldiers called the \"Unsullied\". The Qarth warlocks attempt to assassinate her, but Selmy, a former Kingsguard commander, saves her and pledges his loyalty.'),(3,2,22,'Dark Wings, Dark Words',57,'Daniel Minahan','Vanessa Taylor','7-Apr-2013',4.27,'Ramin Djawadi','Jonathan Freeman','Frances Parker',8.5,89,7.4,'April 10, 2012','July–November 2012','A Storm of Swords','Brienne continues escorting Jaime Lannister across the Riverlands to King\'s Landing. He engages her in a fight, which is interrupted by Bolton soldiers who capture them. Robb Stark receives news that Winterfell was sacked, and his brothers Bran and Rickon have vanished. Robb diverts his attention from the war against the Lannisters to attend the funeral in Riverrun for Hoster Tully, Catelyn\'s father. This angers Rickard Karstark, who seeks vengeance against the Lannisters for killing his sons. Arya Stark, Gendry and Hot Pie also make for Riverrun, but are waylaid by the rebel \"Brotherhood without Banners\". They stop at an inn, where the captured Hound exposes Arya\'s identity. Margaery and her grandmother Olenna, the \"Queen of Thorns\", persuade Sansa to describe Joffrey\'s deviant character. Theon Greyjoy is tortured by unknown captors. Bran, Rickon, Osha, and Hodor encounter siblings Jojen and Meera Reed, children of Stark bannerman, Howland Reed. Jojen, who shares Bran\'s strange dreams, tells Bran that he can enter animals\' minds.'),(3,3,23,'Walk of Punishment',52,'David Benioff','David Benioff, D. B. Weiss','14-Apr-2013',4.72,'Ramin Djawadi','Matthew Jensen','Katie Weiland',8.7,92,8.8,'April 10, 2012','July–November 2012','A Storm of Swords','Robb and Catelyn attend Hoster Tully\'s funeral in Riverrun. Tywin Lannister sends Littlefinger to the Eyrie to marry Lysa Arryn to secure her alliance, and makes Tyrion the new Master of Coin. Hot Pie is employed by the inn, while Arya and Gendry follow the Brotherhood. Learning of the massacre at the Fist of the First Men, Rayder sends Jon and a band of Wildlings to scale the Wall and attack the Watch while it is weakened. The surviving Night\'s Watch men return to Craster\'s Keep, where Gilly gives birth to a son. Theon is freed by an unknown man, who later rescues him again. Melisandre leaves Dragonstone, mysteriously stating that the blood of a king is required for victory. Daenerys barters for the 8,000 Unsullied and the translator Missandei in exchange for one of her young dragons, ignoring Selmy\'s and Jorah\'s advice. Jaime persuades his captor, Locke, to prevent Brienne being raped by claiming her father will pay a huge ransom; Locke agrees but he then severs Jaime\'s right hand without warning.'),(3,4,24,'And Now His Watch Is Ended',53,'Alex Graves','David Benioff, D. B. Weiss','21-Apr-2013',4.87,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',9.5,100,9.3,'April 10, 2012','July–November 2012','A Storm of Swords','Theon\'s \"rescuer\" betrays him, returning him to the prison for more torture. After a failed escape attempt, Jaime believes himself lost without his sword hand; Brienne urges him to remain hopeful. Varys tells Tyrion how he became a eunuch, then shows him the magician who castrated him, who is now his captive. He advises Tyrion be patient for vengeance. At Craster\'s Keep, the surviving Night\'s Watchmen, starving, come into conflict with their host. Craster and Mormont are slain in the struggle, and Sam flees with Gilly and her new-born son. Arya and Gendry are taken to the Brotherhood\'s secret cave, meeting their leader, Dondarrion, who later sentences Sandor Clegane to trial by combat with him. Margaery proposes that Sansa marry Loras, which Sansa finds agreeable, unaware he is gay. Daenerys meets with slaver Kraznys to trade one dragon for the Unsullied army. Once the deal is struck, she commands the Unsullied to kill all the slave masters, and has her dragon burn Kraznys; she frees the Unsullied, who willingly follow her.'),(3,5,25,'Kissed by Fire',57,'Alex Graves','Bryan Cogman','28-Apr-2013',5.35,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',8.9,100,9.2,'April 10, 2012','July–November 2012','A Storm of Swords','Tyrion, knowing the Crown is deeply in debt to the Iron Bank, persuades Olenna to pay for half of the royal wedding. Sansa tells Littlefinger she wants to remain in King\'s Landing. Tywin discovers the Tyrells\' intend to marry Sansa to Loras. To circumvent this, he plots to marry Sansa to Tyrion, and Cersei to Loras over both Lannister\'s objections. Stannis confesses his infidelity to his wife, Selyse, who says she knows and approves. Their daughter, Princess Shireen, sneaks into the dungeon to visit Davos and teaches him to read. Sandor is released after killing Dondarrion in the trial by combat. Thoros resurrects Dondarrion, using the Lord of Light\'s power. Gendry remains with the Brotherhood, who intend to ransom Arya to Robb. After being delivered to Roose Bolton, Jaime tells Brienne he killed \"Mad\" King Aerys Targaryen to prevent his destroying King\'s Landing with wildfire. Robb executes Lord Karstark after the latter murders two captive Lannister boys. With the Karstarks abandoning him, Robb hopes to make a new alliance with Walder Frey. Ygritte seduces Jon, who breaks his Night\'s Watch vows. Daenerys encourages the Unsullied to choose a leader among them; they choose Grey Worm.'),(3,6,26,'The Climb',53,'Alik Sakharov','David Benioff, D. B. Weiss','5-May-2013',5.5,'Ramin Djawadi','David Katznelson','Oral Norrie Ottey',8.7,83,8.7,'April 10, 2012','July–November 2012','A Storm of Swords','In King\'s Landing, Tywin coerces Olenna into an agreement to marry Cersei to Loras. Cersei admits to Tyrion that Joffrey tried to have him killed during the siege. Tyrion informs Shae and Sansa about his and Sansa\'s betrothal. Littlefinger tells Varys that he discovered Ros was Varys\' informant and that Joffrey killed her. In the Riverlands, Melisandre buys Gendry from the Brotherhood, and foretells Arya that she will kill many people with brown eyes, green eyes, and blue eyes; she promises they will meet again. Having married Talisa, Robb strikes a new agreement with Walder Frey by giving him Harrenhal and having his uncle, Edmure Tully, marry a Frey daughter or granddaughter. Roose Bolton plans to send Jaime to King\'s Landing, but refuses to allow Brienne to accompany him. At an unknown location, the mysterious man continues torturing Theon. In the North, tension arises between Osha and Meera. Beyond the Wall, Sam continues his flight with Gilly, while Jon and Ygritte scale the Wall with two other Wildlings.'),(3,7,27,'The Bear and the Maiden Fair',57,'Michelle MacLaren','George R. R. Martin','12-May-2013',4.84,'Ramin Djawadi','Chris Seager','Frances Parker',8.6,78,8.5,'April 10, 2012','July–November 2012','A Storm of Swords','In the North, Jojen tells Bran they must not stop at Castle Black, but travel beyond the Wall to find the Three-eyed Raven; Osha warns them about the White Walkers. Jon and Ygritte\'s relationship deepens, angering jealous Wildling, Orell. Theon\'s torturer castrates him. Robb learns Talisa is pregnant. Arya escapes the Brotherhood, only to be captured by Sandor. Melisandre tells Gendry that his father was King Robert. Shae warns Tyrion that their relationship will end once he marries Sansa. Tywin and Joffrey discuss Daenerys; Tywin dismisses her as a potential threat. Daenerys reaches Yunkai and declares war on the city. Roose Bolton leaves Harrenhal for Edmure Tully\'s wedding while Jaime bids Brienne farewell as he departs for King\'s Landing. On the road, Jaime learns Locke has refused Brienne\'s father\'s ransom. He returns to Harrenhal to find Brienne in a pit fighting a bear. He saves her and they depart to King\'s Landing together.'),(3,8,28,'Second Sons',56,'Michelle MacLaren','David Benioff, D. B. Weiss','19-May-2013',5.13,'Ramin Djawadi','Chris Seager','Frances Parker',8.9,97,9.1,'April 10, 2012','July–November 2012','A Storm of Swords','King\'s Landing hosts Tyrion and Sansa\'s wedding. Cersei shows her displeasure toward Margaery and Loras. At the wedding feast, Tyrion causes a drunken scene. Tywin demands that Tyrion quickly produce a Lannister heir, but Tyrion later assures Sansa their marriage will never be consummated without her consent. Sandor tells Arya they are heading for the Twins to ransom her to Robb. Stannis releases Davos, demanding he respect Melisandre. She arrives in Dragonstone with Gendry, whom she seduces to extract his blood using leeches. In a magical ritual, Stannis casts the blood-filled leeches into a fire while naming three usurpers: Robb Stark, Balon Greyjoy, and King Joffrey. Daenerys learns that Yunkai has employed mercenaries called the \"Second Sons\". One of their handsome lieutenants, Daario Naharis, kills the other leaders and pledges the company\'s loyalty to Daenerys. Sam and Gilly are attacked by a White Walker, which Sam destroys with a dragonglass dagger.'),(3,9,29,'The Rains of Castamere',50,'David Nutter','David Benioff, D. B. Weiss','2-Jun-2013',5.22,'Ramin Djawadi','Robert McLachlan','Oral Norrie Ottey',9.9,100,9.7,'April 10, 2012','July–November 2012','A Storm of Swords','Sam, Gilly, and her son arrive at the Wall. While hiding in a tower during a thunderstorm, Bran enters Hodor\'s mind to prevent his revealing their hiding place to Wildlings below with his laments. Nearby, Jon refuses to murder a farmer, whom Ygritte kills; Jon is attacked by the other Wildlings but escapes. Bran uses his warg ability to save Jon, who kills Orell before escaping, leaving a furious Ygritte behind with chief Tormund. Osha, Rickon, and his direwolf, Shaggydog, depart for the Last Hearth, while Bran, Meera, Jojen, Hodor and Bran\'s direwolf, Summer, plan to go beyond the Wall. Daenerys sends Jorah, Naharis, and Grey Worm to infiltrate Yunkai and open the city gate for her army. Yunkai slaves willingly surrender to her forces. Robb arrives at the Twins and apologizes to Walder for reneging on his agreement to marry a Frey daughter. Walder appears to accept his apology while Edmure marries Roslin Frey, Walder\'s sole pretty granddaughter. After the newlyweds leave the feast, Walder\'s men murder Catelyn, Talisa and the Stark bannermen, while Roose Bolton, now a Lannister loyalist, kills Robb. Ser Brynden Tully, Catelyn\'s uncle, survives, having excused himself from the feast just prior to the slaughter. The Hound and Arya arrive at the Twins during the massacre, but the Hound carries her to safety.'),(3,10,30,'Mhysa',62,'David Nutter','David Benioff, D. B. Weiss','9-Jun-2013',5.39,'Ramin Djawadi','Robert McLachlan','Oral Norrie Ottey',9,100,8.5,'April 10, 2012','July–November 2012','A Storm of Swords','The massacre\'s mastermind is revealed to be Tywin Lannister, who rewards House Frey with the Seat of Riverrun and appoints Roose Bolton as Warden of the North. Theon learns his men surrendered him in return for safe passage from Winterfell and that his captor is Ramsay Snow, Bolton\'s bastard son. Against Balon\'s wishes, Yara leads a mission to rescue Theon. Arya and the Hound kill some Frey soldiers mocking Robb\'s death. Jaime and Brienne arrive in King\'s Landing where Jamie is reunited with Cersei. Sam and Gilly encounter Bran\'s party and, unable to prevent them traveling beyond the wall, Sam gives them dragonglass weapons. Sam returns to Castle Black with Gilly. Maester Aemon has Sam send ravens to alert the Seven Kingdoms about the White Walkers. Ygritte finds Jon and shoots him with three arrows, deliberately only wounding him. He escapes, returning to Castle Black. In Dragonstone, Davos helps Gendry escape to prevent his being sacrificed; Stannis forgives Davos, then heads north to aid the Watch against the White Walker threat. In Essos, the freed Yunkai slaves receive Daenerys as their \"mother\".'),(4,1,31,'Two Swords',58,'D. B. Weiss','David Benioff, D. B. Weiss','6-Apr-2014',6.64,'Ramin Djawadi','Jonathan Freeman','Katie Weiland',9,95,9.1,'April 2, 2013','July–November 2013','A Storm of Swords','Tywin oversees the reforging of Ice, House Stark\'s ancestral Valyrian steel sword, into two new ones. One is for Jaime, who grieves the loss of his sword hand and Cersei\'s love, and the other is a wedding present for King Joffrey, which Joffrey names Widow\'s Wail. Prince Oberyn Martell, representing his infirmed brother, Prince Doran of Dorne, arrives in King\'s Landing to attend the royal wedding. He and his paramour, Ellaria Sand, are greeted by Tyrion. Oberyn secretly seeks revenge against the Lannisters and Gregor Clegane for the rape and murder of his sister, Elia, wife of the unfaithful Prince Rhaegar Targaryen. In the North, Styr and the cannibalistic Thenns reinforce Tormund, Ygritte and the other Wildlings. Maester Aemon absolves Jon after he explains his actions while with the Wildlings and reveals that their army of 100,000 plans to attack Castle Black. In the Riverlands, the Hound and Arya head to the Eyrie where the Hound intends to ransom Arya to her Aunt Lysa, Jon Arryn\'s widow. Along the way, Arya reclaims her sword, Needle, from Polliver, killing him. In Essos, Daenerys marches her army towards Meereen, the last of the three great slave cities; she fears she is losing control over her growing dragons, now horse-sized.'),(4,2,32,'The Lion and the Rose',52,'Alex Graves','George R. R. Martin','13-Apr-2014',6.31,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',9.7,100,9.4,'April 2, 2013','July–November 2013','A Storm of Swords','Roose Bolton returns to the Dreadfort with his bride, one of Walder Frey\'s daughters. He chastises Ramsay for torturing and castrating Theon, devaluing him as a hostage. Theon, who has degenerated into a subservient persona called \'Reek\', discloses that Bran and Rickon Stark are alive and threaten Roose\'s legitimacy as Warden of the North. Roose orders Ramsay to reclaim the territories under Ironborn occupation, promising a reward if he succeeds. In Dragonstone, Melisandre sacrifices three people, including Stannis\' brother-in-law, burning them to death as a tribute to the Lord of Light, delighting Queen Selyse and disgusting Ser Davos and Princess Shireen. To protect Shae from his family, Tyrion arranges to send her to Pentos on Essos, leaving her distressed. Bronn coaches Jaime in left-handed swordplay. King Joffrey and Margaery Tyrell are wed. During the Royal Wedding feast, Joffrey humiliates Tyrion and taunts Sansa just before Joffrey fatally succumbs to poisoned wine. A distraught Cersei has Tyrion arrested for his murder, while Ser Dontos, a former knight, persuades Sansa to leave the feast with him for her protection.'),(4,3,33,'Breaker of Chains',56,'Alex Graves','David Benioff, D. B. Weiss','20-Apr-2014',6.59,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',8.7,96,7.9,'April 2, 2013','July–November 2013','A Storm of Swords','Tywin grooms his young grandson Tommen to be the new king and enlists Oberyn and Mace Tyrell as his fellow judges for Tyrion\'s impending murder trial. Tyrion chooses Jaime as his witness. Littlefinger, who hired Ser Dontos to retrieve Sansa, has him killed, then smuggles her out of King\'s Landing aboard his ship. In the Riverlands, Arya and the Hound are offered hospitality by a peasant farmer and his daughter, whom the Hound soon robs, angering Arya. To replenish Stannis\' depleted forces, Davos wants to request a loan from the Iron Bank of Braavos to hire mercenaries called the \"Golden Company\". At Castle Black, Sam fears for Gilly\'s safety and moves her and Little Sam to nearby Mole\'s Town. Meanwhile, the Wildlings continue to raid northern villages. The Night\'s Watch learns that the mutineers are camped at Craster\'s Keep. Jon proposes an attack on them to prevent them leaking Castle Black\'s defense weaknesses to Mance Rayder\'s approaching army. Daenerys arrives at Meereen and gives a rousing speech before the gates, offering the city\'s slaves their freedom.'),(4,4,34,'Oathkeeper',55,'Michelle MacLaren','Bryan Cogman','27-Apr-2014',6.95,'Ramin Djawadi','Robert McLachlan','Crispin Green',8.7,96,9,'April 2, 2013','July–November 2013','A Storm of Swords','Daenerys easily captures Meereen, assisted by a slave revolt. Seeking justice for 163 slain slave children, she nails 163 masters to the same road posts. At sea, Littlefinger reveals his complicity in Joffrey\'s death to Sansa. Before leaving King\'s Landing, Olenna implies to Margaery that she poisoned Joffrey. She urges Margaery to marry Tommen before Cersei can turn him against her. Jaime believes Tyrion is innocent, but Cersei is adamant he is guilty and also orders Jaime to locate and kill Sansa as an accomplice. Jaime instead sends Brienne to find and protect Sansa, presenting her with new armor, his Valyrian sword, horses and Podrick Payne as her squire. In the North, hoping to eliminate Jon, Alliser Thorne and Janos Slynt agree to allow Jon to lead the expedition against the mutineers. Unknown to Jon, the mutineers have captured Bran and his companions. Further north, a White Walker takes Craster\'s last newborn son to a secret ritual site where he is transformed into a Walker.'),(4,5,35,'First of His Name',53,'Michelle MacLaren','David Benioff, D. B. Weiss','4-May-2014',7.16,'Ramin Djawadi','Robert McLachlan','Crispin Green',8.6,98,8.9,'April 2, 2013','July–November 2013','A Storm of Swords','Tommen is crowned king; Cersei surprises Margaery by encouraging her to marry Tommen. Tywin asks Oberyn to be a judge at Tyrion\'s trial and swears his innocence in Elia\'s rape and murder. In the Vale, Littlefinger takes Sansa to the Eyrie where she is reunited with her aunt, Lysa Arryn, who pressures Littlefinger to marry her immediately. It is revealed that Lysa and Littlefinger killed Jon Arryn and framed the Lannisters. Lysa plans for Sansa to marry her son, Robin, an emotionally immature prepubescent boy. The Hound mocks Arya practicing her water dancing and disparages Syrios Forell\'s fighting style. Brienne learns that Podrick lacks practical squiring skills but is impressed he killed a Kingsguard to protect Tyrion. Beyond the Wall, Jon\'s group find and defeat the mutineers. Unknown to Jon, Bran and his companions are captives there. Locke attempts to kidnap Bran in the confusion, but Hodor, warged into by Bran, kills him and frees the others. Jojen convinces Bran that they must continue north, while Jon\'s men are burning Craster\'s Keep and free his daughter/wives. In Meereen, after Jorah informs Daenerys that Astapor and Yunkai have reverted to slavery, she postpones invading Westeros to instead rule as queen until Slaver\'s Bay is truly free.'),(4,6,36,'The Laws of Gods and Men',50,'Alik Sakharov','Bryan Cogman','11-May-2014',6.4,'Ramin Djawadi','Fabian Wagner','Crispin Green',9.7,94,8.6,'April 2, 2013','July–November 2013','A Storm of Swords','In Essos, Davos and Stannis meet with the Iron Bank to secure a loan for Stannis. Davos re-engages Salladhor Saan and his pirates. In Meereen, Daenerys adapts to her new role as queen, hearing her subjects\' endless requests, including nobleman Hizdahr zo Loraq who wishes to reclaim his crucified father\'s body, and a peasant man whose goats were killed by Daenerys\' increasingly uncontrollable dragons. In the Dreadfort, Yara leads a mission to rescue Theon, who, emotionally broken, refuses to leave, forcing Yara to abandon him. Ramsay rewards Theon\'s obedience and, planning to take Moat Cailin, tasks \"Reek\" to impersonate \"Theon Greyjoy\". In King\'s Landing, Tywin puts a bounty on the Hound\'s head and instructs Varys to continue spying on Daenerys. Tyrion is tried for Joffrey\'s murder. All the witnesses testify against him, including Ser Meryn Trant, Grand Maester Pycelle, Cersei, and Varys, who give compelling, though circumstantial, testimony. To Tyrion\'s shock, Shae falsely testifies against him. Tyrion proclaims his innocence and demands a trial by combat.'),(4,7,37,'Mockingbird',51,'Alik Sakharov','David Benioff, D. B. Weiss','18-May-2014',7.2,'Ramin Djawadi','Fabian Wagner','Tim Porter',9,100,9.2,'April 2, 2013','July–November 2013','A Storm of Swords','Cersei appoints Ser Gregor Clegane as her champion in Tyrion\'s upcoming trial by combat. Jaime and Bronn decline to fight Ser Gregor for Tyrion, but Oberyn accepts. He seeks to avenge his sister, Elia\'s rape and murder by Ser Gregor during the rebellion. Daenerys takes Daario as her lover, then sends him to handle the resurgent slavers at Yunkai. Melisandre and Selyse prepare to depart Dragonstone, intending to take Shireen with them. As the Wildlings approach Castle Black, Alliser Thorne rejects Jon\'s suggestion to seal the tunnel. At an inn, Brienne and Podrick meet Hot Pie, who updates them about Arya. They resolve to travel to the Vale, deducing she would seek her living relatives there. In the Vale, Lysa witnesses Littlefinger kissing Sansa. Enraged, she later threatens to throw Sansa through the moon door, a circular opening in the floor with a steep drop to rocks below; Littlefinger intervenes and shoves Lysa to her death.'),(4,8,38,'The Mountain and the Viper',52,'Alex Graves','David Benioff, D. B. Weiss','1-Jun-2014',7.17,'Ramin Djawadi','Anette Haellmigk','Tim Porter',9.7,96,9.6,'April 2, 2013','July–November 2013','A Storm of Swords','The Wildlings attack Mole\'s Town. Ygritte discovers Gilly hiding and spares her and Little Sam. Ramsay forces Theon to negotiate with the Ironborn to surrender Moat Cailin. The Ironborn agree, hoping to return home, but Ramsay flays and slaughters them. As a reward for securing Moat Cailin, Roose legitimizes Ramsay as a Bolton, making him his heir. In the Vale, Sansa tells the council investigating Lysa\'s death her true identity and claims that Littlefinger is innocent of murdering her aunt. While Littlefinger starts grooming Robin as the Lord of the Vale, the Hound and Arya arrive, only to leave upon learning of Lysa\'s death. In King\'s Landing, the trial by combat begins. Oberyn gains the upper hand but momentarily relaxes his guard while demanding that Ser Gregor confess his crimes. Near death, Ser Gregor trips Oberyn and crushes his skull while boasting that he raped and murdered Elia. Tywin sentences Tyrion to death. In Essos, Grey Worm and Missandei grow closer. Barristan Selmy intercepts a long-delayed pardon from King Robert for Jorah as a reward for spying on Daenerys. She then exiles Jorah from Meereen as a result.'),(4,9,39,'The Watchers on the Wall',50,'Neil Marshall','David Benioff, D. B. Weiss','8-Jun-2014',6.95,'Ramin Djawadi','David Franco','Katie Weiland',9.6,94,9.4,'April 2, 2013','July–November 2013','A Storm of Swords','The Night\'s Watch prepares for the battle. Maester Aemon is revealed to be a Targaryen. Gilly and Little Sam escape Mole\'s Town and arrive at Castle Black, where Sam hides them. The Wildlings attack from both sides of the wall. Tormund\'s army breaks through from the south and engages the Night\'s Watch. A giant breaches the tunnel into Castle Black but is killed by Grenn and five others, at the cost of their own lives. Alliser Thorne joins the fight in the southern part, leaving the incompetent Janos Slynt commanding the Wall. Slynt is told a lie to make him leave the wall and Jon takes charge. After seeing Jon kill Styr, Ygritte aims her bow at him but hesitates, then is fatally shot by Olly. Assisted by Ghost, Jon\'s direwolf, the Night\'s Watch secure Castle Black\'s inner keep, and a wounded Tormund is arrested. The wall climbers are obliterated by a massive swinging scythe. The Wildlings retreat for the night. Jon goes beyond the Wall to find and kill Mance Rayder, believing that the Wildling army will fragment without his command.'),(4,10,40,'The Children',65,'Alex Graves','David Benioff, D. B. Weiss','15-Jun-2014',7.09,'Ramin Djawadi','Anette Haellmigk','Tim Porter',9.6,98,8.4,'April 2, 2013','July–November 2013','A Storm of Swords','Jon\'s meeting with Mance Rayder abruptly ends when Stannis and his army overrun the Wildling camp, taking Mance prisoner. Bran finds the weirwood tree from his visions but skeletal creatures attack the group, killing Jojen. A Child of the Forest saves the others and takes them to the Three-Eyed Raven, revealed to be an old man encased within tree roots inside a secure cave. In the Vale, Brienne and Podrick encounter Arya and the Hound, who attacks Brienne; she critically wounds him, while Arya runs off and evades Brienne. The Hound begs Arya to kill him, but she takes his money and leaves him for dead. She boards a ship headed to Braavos to find H\'ghar. In King\'s Landing, Cersei orders Qyburn to save Ser Gregor, who was poisoned by Oberyn\'s blade. Jaime releases Tyrion from prison, but before escaping the city, Tyrion finds Shae in Tywin\'s bed and fatally strangles her. He confronts and kills Tywin in the privy, then is smuggled aboard a ship by Varys. In Meereen, some ex-slaves miss their bonds, finding freedom a hardship. A citizen brings Daenerys his daughter\'s charred remains, burned by dragon fire. Daenerys chains Rhaegal and Viserion in the catacombs, while Drogon remains at large.'),(5,1,41,'The Wars to Come',52,'Michael Slovis','David Benioff, D. B. Weiss','12-Apr-2015',8,'Ramin Djawadi','David Franco','Katie Weiland',8.3,96,8.7,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','In a flashback, a witch foretells a teenage Cersei that she will one day be a queen until a younger and more beautiful queen usurps her. The witch also predicts Cersei will have three children and her king husband will have twenty. In the present, Tywin is buried, and Lancel Lannister returns, now a devoted convert of a fanatical religious cult called the \"Sparrows\". In Pentos on Essos, a despondent Tyrion accompanies Varys to Meereen to meet Daenerys, who Varys believes may be worthy of the Iron Throne. In Meereen, the insurgent \"Sons of the Harpy\" murder an Unsullied. Daenerys angrily resists restoring old local traditions, including reopening the fighting pits. Missandei asks Grey Worm about why some Unsullied visit brothels. Daenerys visits her two confined dragons, who act aggressively toward her. In the Vale, Littlefinger puts Robin in House Royce\'s care when he and Sansa depart. At the Wall, Stannis Baratheon seeks to recruit the Wildlings in his war against Roose Bolton, offering citizenship and land as a reward. Jon is unable to persuade Mance Rayder to \"bend the knee\" to Stannis. As Mance is burned alive, Jon ends his agony with an arrow to the heart.'),(5,2,42,'The House of Black and White',55,'Michael Slovis','David Benioff, D. B. Weiss','19-Apr-2015',6.81,'Ramin Djawadi','David Franco','Katie Weiland',8.4,96,8.9,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Arya arrives in Braavos and is accepted into the \"House of Black and White\" by Jaqen H\'ghar, who calls himself and his colleagues, \"no one\". Jaime recruits Bronn to travel to Dorne with him to retrieve Jaime\'s niece/daughter Myrcella, who is now betrothed to Trystane Martell, Prince Doran\'s son. Podrick recognises Littlefinger and Sansa in a tavern; Brienne offers Sansa her protection but is rebuffed. Littlefinger insists Brienne come with them, but she refuses and escapes with Podrick, then secretly follows Sansa. Stannis offers Jon legitimacy and lordship of Winterfell if he leaves the Night\'s Watch and supports him, but Jon keeps his vow to the Night\'s Watch; Samwell nominates Jon as Lord Commander against Alliser Thorne; Maester Aemon casts his ballot for Jon, breaking a tie vote. Daenerys incites a riot by executing a former slave who murdered a Sons of the Harpy prisoner prior to his trial. Drogon reappears, but soon leaves.'),(5,3,43,'High Sparrow',59,'Mark Mylod','David Benioff, D. B. Weiss','26-Apr-2015',6.71,'Ramin Djawadi','Anette Haellmigk','Tim Porter',8.4,100,9,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Margaery, newly wed to King Tommen Baratheon, manipulates him to consider sending Cersei to Casterly Rock to eliminate her interference. Littlefinger takes Sansa to Winterfell to cement an alliance with Roose Bolton through marriage to his son, Ramsay and Sansa without the Lannisters knowledge. Sansa\'s unconsummated marriage with Tyrion is considered void. Brienne trains Podrick in swordsmanship. To conform to the House of Black and White, Arya tosses her personal effects into the harbor, but hides Needle in a pile of rocks. At Castle Black, Jon names Thorne First Ranger. When Slynt disobeys Jon\'s orders, Jon executes him. Lancel discovers the High Septon in a brothel, and he is forced to walk the streets nude as punishment. The High Septon protests to Cersei, who imprisons him. She meets with the High Sparrow, approving the Sparrows\' actions. Tyrion and Varys arrive in Volantis. Soon after, Tyrion is abducted by Jorah, intending to give him, \"to the queen\".'),(5,4,44,'Sons of the Harpy',50,'Mark Mylod','Dave Hill','3-May-2015',6.82,'Ramin Djawadi','Anette Haellmigk','Tim Porter',8.5,96,6.5,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Cersei authorizes arming the Sparrows as the Faith Militant, who then arrest Loras Tyrell for homosexuality. Queen Margaery is enraged, but Tommen proves too weak to countermand them. Melisandre attempts to seduce Jon as a means to convince him to accompany Stannis to Winterfell. In Winterfell, before Littlefinger heads to King\'s Landing, he dispels Sansa\'s misgivings about marrying Ramsay, promising that Stannis will defeat the Boltons and rescue her, and even if not, she can manipulate Ramsay. Bronn and Jaime secretly land in Dorne to retrieve Myrcella; hearing this, Ellaria and her Sand Snakes plot to avenge Oberyn\'s death by abducting Myrcella. Jorah intends to redeem himself to Daenerys by presenting Tyrion as a prisoner. In Meereen, Loraq again appeals to Daenerys to reopen the fighting pits, a local tradition; the Sons of the Harpy ambush an Unsullied patrol inside the citadel, critically wounding Grey Worm and killing Ser Barristan Selmy.'),(5,5,45,'Kill the Boy',56,'Jeremy Podeswa','Bryan Cogman','10-May-2015',6.56,'Ramin Djawadi','Gregory Middleton','Crispin Green',8.5,94,9,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Brienne and Podrick arrive at an inn near Winterfell and smuggle a message to Sansa, offering her help if it is needed. Sansa discovers Theon is at Winterfell, and Ramsay forces him to apologize to her for supposedly killing her younger brothers. At the Wall, Tormund Giantsbane agrees to an alliance with the Night\'s Watch in return for the Wildlings to settle south of the Wall. Jon and Tormund travel to Hardhome to persuade the Wildlings. Stannis\'s army leaves for Winterfell, taking his family and Melisandre with them. In Meereen, as Grey Worm recuperates, he and Misandei develop romantic feelings. Daenerys feeds one Meereen nobleman to her dragons, Viserion and Rhaegal, and imprisons the others. She later agrees to reopen the fighting pits and weds Loraq to facilitate peace. At sea, Tyrion and Jorah sail through Valyria, seeing Drogon flying overhead. They are attacked by stone men and escape, but Jorah is infected with greyscale.'),(5,6,46,'Unbowed, Unbent, Unbroken',53,'Jeremy Podeswa','Bryan Cogman','17-May-2015',6.24,'Ramin Djawadi','Gregory Middleton','Crispin Green',7.9,54,7.6,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','H\'ghar takes Arya to a chamber filled with the faces of dead people. Jaime and Bronn reach the Water Gardens and find Myrcella with Trystane. The Sand Snakes attack them but Dornish guards arrive and arrest everyone. Jorah and Tyrion are captured by pirates. They narrowly escape slavery when Tyrion manages to talk their way to the fighting pits of Meereen. Littlefinger informs Cersei that Roose Bolton intends to marry Sansa to Ramsay. He offers to lead the knights of the Vale to Winterfell to defeat whichever weakened side wins the conflict between Roose and Stannis. If successful, Littlefinger will be named Warden of the North. Olenna Tyrell arrives in King\'s Landing and warns Cersei that imprisoning Loras has jeopardized their alliance. At Loras\' inquest, Loras and Margaery both deny his homosexuality. The male prostitute, Olyvar, contradicts their testimony and Margaery is arrested for lying to the gods. Tommen is uncertain and ineffective. At Winterfell, Sansa weds Ramsay. On their wedding night, Ramsay rapes her in front of Theon.'),(5,7,47,'The Gift',58,'Miguel Sapochnik','David Benioff, D. B. Weiss','24-May-2015',5.4,'Ramin Djawadi','Fabian Wagner','Crispin Green',8.8,84,7.8,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Jon leaves for Hardhome with Tormund and some rangers. Maester Aemon dies shortly after. Gilly is attacked by two Watchmen. Samwell intervenes and is overpowered until Ghost threatens them. Samwell and Gilly consummate their relationship. Sansa begs Theon to help her escape Winterfell, but instead he informs Ramsay, who then flays Brienne\'s informant inside Winterfell. At his army camp, Stannis refuses Melisandre\'s request to sacrifice Shireen to gain the Lord of Light\'s favor. Jorah and Tyrion are sold to slaver, Qaggaz, and are taken to Daznak\'s fighting pit. Daenerys and her consort, Loraq, inspect the pit in preparation for the upcoming games. Jorah defeats the other fighters, reveals his identity and Tyrion appears as his \"gift\" to her. In Dorne, while in the dungeon, Tyene Sand gives Bronn the antidote to a poison called \"The Long Farewell\" that she has infected him with. Prince Doran allows Jaime to take Myrcella and her fiancé, Prince Trystane, to King\'s Landing. The High Sparrow denies Olenna\'s demand that Loras and Margaery be released. The High Sparrow then arrests Cersei for her previous affair with her cousin Lancel.'),(5,8,48,'Hardhome',60,'Miguel Sapochnik','David Benioff, D. B. Weiss','31-May-2015',7.01,'Ramin Djawadi','Fabian Wagner','Tim Porter',9.8,100,9.1,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Cersei\'s uncle, Kevan Lannister, is appointed as the Hand of the King. Cersei refuses to confess her crimes. H\'ghar tasks Arya to study a marine insurance vendor who defrauds beneficiaries. Disguised as a shellfish peddler, she is to first learn about the insurer and then poison him. Theon tells Sansa that he faked killing Brandon and Rickon. Ramsay asks Roose for twenty men to attack Stannis\'s camp. In Meereen, Tyrion convinces Daenerys to spare Jorah\'s life; she does but exiles him again. Jorah returns to Yezzan and asks to fight in the pits. Daenerys accepts Tyrion into her council. Arriving in Hardhome, Jon and Tormund recruit five thousand Wildlings but an army of wights attacks them. Jon kills a White Walker with Longclaw, his Valyrian steel sword. As he, Tormund, and the other survivors escape by sea, they witness the Night King reanimating the dead Wildlings.'),(5,9,49,'The Dance of Dragons',52,'David Nutter','David Benioff, D. B. Weiss','7-Jun-2015',7.14,'Ramin Djawadi','Robert McLachlan','Katie Weiland',9.4,83,8.1,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Ramsay leads a covert attack on Stannis\' camp, destroying siege equipment, food stores, and killing many horses. After dispatching Davos to Castle Black to request more supplies, Stannis, with Selyse\'s approval, allows Melisandre to sacrifice Shireen, burning her alive at the stake, believing it will help win the war. Jon and the other survivors return to the Wall, allowing the Wildlings to pass South. In Dorne, Prince Doran has permitted Jaime and Bronn to return to King\'s Landing with Myrcella, provided Trystane accompanies them and serves on the small council in Oberyn\'s stead. Doran also pardons Ellaria and her daughters. Arya aborts her first assassination assignment after spotting Trant accompanying Mace Tyrell, the Master of Coin, who has arrived in Braavos to negotiate with the Iron Bank. In Meereen, combat at Daznak\'s fighting pit resume. Daenerys is stunned that Jorah is among the fighters. His victory is interrupted when the Sons of the Harpy launch a surprise attack. Loraq is killed while Jorah saves Daenerys. The Harpies quickly swarm Daenerys and her supporters, forcing them and Jorah to retreat into the pit. Drogon suddenly arrives, burning many Sons of the Harpy; Daenerys mounts Drogon and commands him to fly away.'),(5,10,50,'Mother\'s Mercy',60,'David Nutter','David Benioff, D. B. Weiss','14-Jun-2015',8.11,'Ramin Djawadi','Robert McLachlan','Tim Porter',9.1,92,8.3,'April 8, 2014','July–December 2014','A Feast for Crows, A Dance with Dragons and original content','Selyse, now distraught over Shireen\'s death, hangs herself, while half of Stannis\' forces desert and Melisandre flees to Castle Black. The Boltons easily defeat Stannis\' depleted army. Brienne finds Stannis on the battlefield and executes him for Renly Baratheon\'s murder. Theon kills Myranda after she catches him and Sansa attempting to escape Winterfell. The duo leap from the outer wall together. Cersei confesses her former relationship with Lancel and must atone by parading the streets naked, pelted with garbage, spit, and feces by jeering crowds. Upon reaching the Red Keep, Qyburn introduces her to the newest Kingsguard member who is completely loyal. Jaime, Myrcella, Bronn, and Trystane set sail from Dorne, but Myrcella has been poisoned by Ellaria Sand and soon dies. Arya is punished, losing her sight, for violating the Faceless Men rules after killing Trant for personal revenge. Varys arrives in Meereen to govern the city with Tyrion, Grey Worm, and Missandei, while Daario and Jorah search for Daenerys, who has been captured by a Dothraki horde. Samwell, Gilly, and Little Sam leave Castle Black for Oldtown where Samwell will train as a Maester. Mutineers, including Alliser Thorne and Jon\'s steward, Olly, fatally stab Jon, leaving his body in the courtyard.'),(6,1,51,'The Red Woman',50,'Jeremy Podeswa','David Benioff, D. B. Weiss','24-Apr-2016',7.94,'Ramin Djawadi','Gregory Middleton','Crispin Green',8.4,86,6.4,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Alliser Thorne assumes command of the Night\'s Watch, while Ser Davos and several loyalists bolt themselves inside a room with Jon\'s body; Edd leaves Castle Black to seek help. At Winterfell, Ramsay briefly mourns Myranda, while Sansa and Theon are pursued by Bolton men. Brienne and Podrick arrive, killing the pursuers. Sansa formally accepts Brienne into her service. Jaime arrives in King\'s Landing with Myrcella\'s body and vows to Cersei to take back everything taken from them. Obara and Nymeria murder Trystane Martell while, in Sunspear, Ellaria and Tyene kill Prince Doran and Areo Hotah after Doran learns of Myrcella\'s murder. In Meereen, Tyrion and Varys discover ships are burning in the harbor. Jorah and Daario Naharis continue tracking Daenerys, whom the Dothraki take to Khal Moro. In Braavos, a blinded Arya begs on the street. Each day, the Waif beats her with a staff and forces her to fight. In her bedchamber, Melisandre removes her bejeweled necklace revealing her true form, a frail and elderly woman.'),(6,2,52,'Home',53,'Jeremy Podeswa','Dave Hill','1-May-2016',7.29,'Ramin Djawadi','Gregory Middleton','Crispin Green',9.3,88,6.2,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','In a vision of the past, Brandon sees his father Ned, Uncle Benjen, their sister Lyanna, and young Hodor at Winterfell. Edd returns to Castle Black with Tormund and a group of Wildlings, imprisoning Thorne and the other mutineers. Tommen asks Cersei to help him be strong, as the High Sparrow threatens Jaime. Astapor and Yunkai have reverted to slavery. In the catacombs, Tyrion unchains Rhaegal and Viserion. In Braavos, H\'ghar allows Arya to return to the House of Black and White. Roose Bolton\'s wife gives birth to a male heir; Ramsay murders Roose, his stepmother, and the infant. En route to Castle Black, Brienne tells Sansa that she had encountered Arya. Theon leaves to head home to the Iron Islands. Euron Greyjoy also returns to Pyke Island and murders his brother, King Balon. Melisandre attempts and apparently fails to resurrect Jon, but after everyone leaves the room, Jon awakens.'),(6,3,53,'Oathbreaker',52,'Daniel Sackheim','David Benioff, D. B. Weiss','8-May-2016',7.28,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',8.6,87,6.2,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','En route to Oldtown to train as a Maester, Samwell first visits Horn Hill, his family home, intending to leave Gilly and Little Sam with his family, claiming Little Sam is his biological son. In a vision, Brandon sees young Ned and Howland Reed, Meera\'s father, dishonorably defeat a Targaryen Kingsguardsmen at the Tower of Joy in Dorne. Varys discovers that the masters of Slavers\' Bay are financing the Sons of the Harpy. In King\'s Landing, the High Sparrow preaches to Tommen, while Jaime, Cersei and her bodyguard, Ser Gregor Clegane, interrupt a small council meeting, only to be shunned by Kevan Lannister and the Tyrells. The Waif rigorously trains Arya, whose sight is restored after accepting herself as \"no-one\". In Winterfell, Lord Umber asks Ramsay to help protect the North from the Wildlings, presenting Rickon Stark, Osha, and the head of Rickon\'s direwolf as gifts. Jon executes Thorne, Olly, and the other mutineers. He renounces his oath and puts Tollett in charge of the Night\'s Watch.'),(6,4,54,'Book of the Stranger',58,'Daniel Sackheim','David Benioff, D. B. Weiss','15-May-2016',7.82,'Ramin Djawadi','Anette Haellmigk','Katie Weiland',9,100,6.6,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Sansa, Brienne and Podrick arrive at Castle Black. Sansa wants Jon to retake the North. In Meereen, Tyrion offers the masters of Slaver\'s Bay peace in exchange for slavery being abolished within seven years; this angers former slaves. Littlefinger returns to the Vale to mobilize its soldiers against Ramsay. Dario learns about Jorah\'s greyscale; they find Daenerys in Vaes Dothrak. In King\'s Landing, Margaery is allowed to visit Loras while Cersei, Jaime, Kevan, and Olenna shelve their differences and plot to defeat the Sparrows. Theon arrives at Pyke Island and supports Yara\'s claim to the Iron Islands throne. In Winterfell, Ramsay kills Osha, who tries to assassinate him. Ramsay sends Jon a message, threatening Rickon unless Sansa is returned. Sansa convinces Jon to retake Winterfell. In the temple of the Dosh Khaleen, Daenerys tells the Khal leaders that they are not fit to lead the Dothraki. She ignites the temple, killing them. When she emerges unscathed, the Dothraki horde kneels before her.'),(6,5,55,'The Door',56,'Jack Bender','David Benioff, D. B. Weiss','22-May-2016',7.89,'Ramin Djawadi','Jonathan Freeman','Crispin Green',9.7,98,7,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Sansa secretly meets with Littlefinger, who offers the Vale\'s forces and says her great uncle, Brynden Tully, is building an army in Riverrun. Sansa distrusts Littlefinger and declines his help. Jon and Sansa leave Castle Black to gather Northern houses\' support. Sansa sends Brienne to meet with her great-uncle, Brynden Tully. In Braavos, Arya is tasked to assassinate Lady Crane, an actress. Beyond the Wall, Brandon learns that the Children of the Forest created the White Walkers to protect themselves from mankind. In the Iron Islands, Euron wins the Kingsmoot, despite confessing he killed Balon; Yara, Theon, and their supporters flee, taking many ships. In Essos, Daenerys orders Jorah to return after finding a cure for his greyscale. In Meereen, Kinvara, a red priestess, meets Tyrion and Varys and promises to support Daenerys. In Brandon\'s unaccompanied vision, the Night King touches him, leaving his mark and making the cave vulnerable. The Night King, White Walkers, and hordes of wights attack the cave, killing the Three-Eyed Raven, several Children, Summer, and Hodor, whose younger self was rendered mentally disabled by Meera’s order to \"Hold the door\".'),(6,6,56,'Blood of My Blood',51,'Jack Bender','Bryan Cogman','29-May-2016',6.71,'Ramin Djawadi','Jonathan Freeman','Yan Miles',8.3,86,6.5,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Meera escapes the cave with Bran, who is immersed in the Three-Eyed Raven\'s transferred visions. In the forest, the wights attack, but a man on horseback saves them. At Horn Hill, Sam\'s father, Randyll, demeans him as a soft bookworm and insults Gilly for being a Wildling. That night, Sam takes House Tarly\'s ancestral Valyrian steel sword, Heartsbane, and leaves with Gilly and Little Sam. Arya warns Lady Crane of her planned assassination, then retrieves Needle. H\'ghar allows the Waif to find and kill Arya. Jaime attempts to rescue Margaery from the Faith Militant, only to find she has repented and Tommen has forged an alliance with the Faith. Tommen forbids Jaime to serve as a King\'s Guard in King\'s Landing and orders him to aid Walder Frey, who is holding Edmure Tully hostage, to retake Riverrun from Brynden Tully. Benjen Stark, the man who saved Meera and Brandon, says he was turned by the White Walkers but later unturned by the Children using Dragonglass. Daenerys mounts Drogon and gives a rousing speech inspiring the Dothraki to cross the Narrow Sea and conquer Westeros for her.'),(6,7,57,'The Broken Man',50,'Mark Mylod','Bryan Cogman','5-Jun-2016',7.8,'Ramin Djawadi','P. J. Dillon','John Harris',8.5,98,6.5,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','The Hound is alive and living a simple, non-violent life, having been saved by a Septon and his followers. When rogue Brotherhood members threaten and eventually slaughter the group, the Hound seeks revenge. Margaery convinces her grandmother to return to Highgarden after the High Sparrow threatens to punish Olenna following her and Jaime\'s confrontation with the Faith. Margaery then secretly signals to Olenna that she has not converted to the Faith. Jon, Sansa, and Davos recruit the wildlings, House Mormont, and others but remain outnumbered by the Boltons. Sansa secretly sends a message to the Vale requesting aid. Jaime arrives in Riverrun with Bronn and assumes command of the siege. Jaime unsuccessfully parleys with Brynden Tully. Theon and Yara spend their last night in Volantis before sailing to Meereen to ally with Daenerys. Arya prepares to return to Westeros until the Waif, disguised as an old crone, viciously stabs her.'),(6,8,58,'No One',58,'Mark Mylod','David Benioff, D. B. Weiss','12-Jun-2016',7.6,'Ramin Djawadi','P. J. Dillon','Katie Weiland',8.3,84,5.8,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Tommen abolishes trial by combat, to Cersei\'s dismay, who planned to win with Ser Gregor as her champion. In Riverrun, Brienne fails to persuade Brynden Tully to surrender the castle and ride safely North. After Jaime threatens to kill Edmure\'s infant son, Edmure enters the castle and orders the Tully forces to stand down. Brynden is killed fighting the Lannisters while Brienne and Podrick escape. Varys departs for Westeros on a secret mission. Meereen comes under naval assault by the slaving cities; Daenerys returns on Drogon, accompanied by the Dothraki. The Hound kills four of the rogues, then encounters Berric Dondarrion and Myr Thoros, who have captured the others. They execute them and ask Clegane to join the Brotherhood. Arya seeks out Lady Crane, who tends her wounds. The Waif kills Lady Crane and pursues Arya through the streets. Arya leads the Waif into darkened catacombs and kills her using Needle. Arya places the Waif\'s face in the House\'s columned collection room and tells H\'ghar that she is Arya Stark of Winterfell, and she is going home.'),(6,9,59,'Battle of the Bastards',59,'Miguel Sapochnik','David Benioff, D. B. Weiss','19-Jun-2016',7.66,'Ramin Djawadi','Fabian Wagner','Tim Porter',9.9,98,8,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','On Tyrion\'s advice, Daenerys meets with three slave masters to negotiate a surrender, which they refuse. The three dragons attack and burn the slavers\' ships. Grey Worm kills two of the masters, leaving one alive to report what he witnessed. Theon and Yara meet with Daenerys and Tyrion to offer an alliance in exchange for the Iron Islands being independent. Near Winterfell, the Stark and Bolton armies meet on the battlefield. Ramsay feigns releasing Rickon before killing him with an arrow. In the battle, the Stark forces are pinned by Bolton soldiers until the Knights of the Vale arrive and overwhelm them. Ramsay flees to Winterfell, but the wildling giant Wun Wun breaches the gate and Ramsay is taken prisoner after Jon beats him senseless. Later, Sansa watches Ramsay\'s starving hounds devour him.'),(6,10,60,'The Winds of Winter',68,'Miguel Sapochnik','David Benioff, D. B. Weiss','26-Jun-2016',8.89,'Ramin Djawadi','Fabian Wagner','Tim Porter',9.9,99,7.8,'April 8, 2014','July–December 2015','Outline from The Winds of Winter and original content','Before her trial, Cersei destroys the Sept of Baelor by wildfire, killing the High Sparrow, the Tyrells, Lancel and Kevan Lannister, hundreds of nobles, and the Faith Militant; Qyburn has Pycelle killed. Cersei reveals her incest with Jamie and that she killed Robert Baratheon to Septa Unella before having Ser Gregor Clegane torture her until she dies. Distraught over Margaery\'s death, Tommen commits suicide. In Dorne, Varys meets with Olenna and Ellaria, seeking an alliance between Daenerys and their Houses against the Lannisters. Davos confronts Melisandre over Princess Shireen\'s death, resulting in Jon banishing her. Led by Lyanna Mormont, the Wildlings and the surviving northern houses pledge loyalty to Jon as King of the North. Sansa rebuffs Littlefinger\'s romantic overtures. Arya kills Walder Frey and his sons. Sam and Gilly reach the Citadel in Oldtown. Benjen accompanies Brandon and Meera to the Wall but is unable to go further. In a vision, Bran sees Ned finding Lyanna Stark as she lies dying after giving birth (to Jon Snow) during King Robert\'s rebellion. Jaime returns to King\'s Landing, and Cersei crowns herself Queen of the Seven Kingdoms. Daenerys names Tyrion Hand of the Queen and sails for Westeros with the Greyjoys, her armies, and her dragons, leaving Daario Naharis and the Second Sons behind to rule Meereen until new leaders are elected.'),(7,1,61,'Dragonstone',58,'Jeremy Podeswa','David Benioff, D. B. Weiss','16-Jul-2017',10.11,'Ramin Djawadi','Gregory Middleton','Crispin Green',8.5,93,6.1,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','At the Twins, Arya, disguised as Walder Frey, poisons the remaining lords of House Frey. The White Walkers march toward the Wall. Edd receives Bran and Meera at Castle Black. At Winterfell, Sansa objects when Jon accepts the loyalties of Houses Umber and Karstark, whose previous leaders supported Ramsay. Queen Cersei demands that the North bend the knee. At the Citadel, Samwell \"borrows\" restricted library books, learning there is a large deposit of dragonglass at Dragonstone; he sends word to Jon. Sam finds Jorah, now heavily infected with greyscale, quarantined in a cell. In the Riverlands, Arya meets some friendly Lannister soldiers, and \"jokingly\" claims she will kill Cersei. The Hound begins to believe in the Lord of Light after Thoros shows him a fiery vision of the Wall and the Army of the Dead. In King\'s Landing, Jaime tells Cersei they crucially need allies. Euron arrives to propose marriage in exchange for his Iron Fleet and an opportunity to kill Theon and Yara. Cersei declines over his untrustworthiness; Euron promises to return with a gift that will prove his loyalty. Daenerys arrives at Dragonstone, House Targaryen\'s ancestral home, with her army and large dragons.'),(7,2,62,'Stormborn',58,'Mark Mylod','Bryan Cogman','23-Jul-2017',9.27,'Ramin Djawadi','P. J. Dillon','Tim Porter',8.8,96,5.8,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','Daenerys heeds Tyrion\'s advice not to take King\'s Landing by force, which would kill thousands. Yara\'s fleet is sent to Sunspear to transport the Dornish army to lay siege to King\'s Landing alongside the Tyrell forces; the Unsullied are to take Casterly Rock. Daenerys challenges Varys\' loyalty and threatens to burn him alive if he ever betrays her. Melisandre arrives and encourages Daenerys to invite Jon Snow to Dragonstone, saying he is integral to the war. Grey Worm and Missandei consummate their relationship. Cersei summons several lords, demanding their fealty, while Jaime offers to elevate Randyll Tarly as Warden of the South. Qyburn shows Cersei a prototype ballista capable of killing dragons. Arya is reunited with Hot Pie, who tells her the Boltons are dead and Jon is now King in the North. She resets course for Winterfell. Jon sets sails for Dragonstone to request Daenerys\' help against the White Walkers, leaving Sansa in charge at Winterfell. He warns Littlefinger to never touch Sansa. Samwell performs a forbidden surgery on Jorah\'s greyscale infection. Euron\'s fleet attacks Yara\'s, killing Obara and Nymeria and capturing Ellaria, Tyene, and Yara. Theon, experiencing flashbacks as Reek, jumps overboard.'),(7,3,63,'The Queen\'s Justice',62,'Mark Mylod','David Benioff, D. B. Weiss','30-Jul-2017',9.25,'Ramin Djawadi','P. J. Dillon','Jesse Parker',9.1,90,6.3,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','Jon arrives at Dragonstone. He refuses Daenerys’ demands to bend the knee, and instead asks her help fighting the Army of the Dead. On Tyrion\'s advice, Daenerys allows Jon to mine the island\'s dragonglass. Melisandre avoids Jon and departs for Volantis, telling Varys she will return to Westeros. Bran, with Meera, arrives at Winterfell and reveals his new Three-Eyed Raven identity to Sansa. In King\'s Landing, Euron presents Ellaria and Tyene as gifts to Cersei, who promises him marriage after the war is won. She makes him commander of her navy. Cersei administers the same poison to Tyene that killed Myrcella; Ellaria will watch her daughter die and remain imprisoned with the body. A healed Jorah leaves Oldtown to find Daenerys. Ebrose praises Samwell\'s skill in saving Jorah then makes him copy old texts for his disobedience. Grey Worm and the Unsullied attack Casterly Rock but discover that Jaime has led the bulk of the Lannister forces to attack Highgarden, while Euron\'s fleet ambushes and destroys the Unsullied\'s ships. The Lannister forces quickly overwhelm Olenna Tyrell\'s army. Jaime offers Olenna a quick and painless death by poison. After drinking it, she reveals she poisoned Joffrey.'),(7,4,64,'The Spoils of War',49,'Matt Shakman','David Benioff, D. B. Weiss','6-Aug-2017',10.17,'Ramin Djawadi','Robert McLachlan','Katie Weiland',9.7,97,6.6,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','Arya returns to Winterfell and is reunited with Sansa and Bran. Littlefinger presents Bran with the Valyrian steel dagger his would-be assassin used. Bran gives the dagger to Arya. Bran bids a homeward-bound Meera an unemotional farewell, explaining he is no longer Bran. Arya spars with Brienne, impressing her and amazing Sansa with her exceptional fighting skills. Cersei assures the Iron Bank full repayment of the Lannister\'s debt as a wagon train carrying gold from Highgarden travels to King\'s Landing. In a cave filled with dragonglass, Jon reveals ancient wall paintings to Daenerys depicting the First Men and the Children of the Forest joining forces against the undead. Daenerys learns that the attack on Casterly Rock was a diversion and Lannister forces have captured Highgarden. Ignoring Tyrion\'s protests, Daenerys rides Drogon as the Dothraki cavalry launches a surprise attack on the Lannister army, decimating it and capturing its remaining forces. Drogon is slightly wounded when Bronn fires a bolt from Qyburn\'s new scorpion ballista weapon, but he and Daenerys land safely. Jaime\'s desperate charge on horseback at a vulnerable Daenerys is thwarted by Drogon spewing fire. Bronn tackles Jaime into a river, saving him.'),(7,5,65,'Eastwatch',58,'Matt Shakman','Dave Hill','13-Aug-2017',10.72,'Ramin Djawadi','Robert McLachlan','Katie Weiland',8.7,95,5.3,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','Jaime and Bronn return to King\'s Landing. Daenerys offers the surviving Lannister soldiers the choice to bend the knee or death. Randyll Tarly and his son, Dickon, refuse her offer, and against Tyrion\'s advice, Daenerys has Drogon burn them to death. Jorah is reunited with Daenerys at Dragonstone. Maester Wolkan alerts Jon and the Citadel about the wights approaching Eastwatch. Jon proposes capturing a wight beyond the Wall to prove their existence and convince Cersei to accept a temporary alliance. Davos smuggles Tyrion inside King\'s Landing to secretly meet with Jaime to propose an armistice. Cersei accepts, and she also informs Jaime she is pregnant with their child. While in King\'s Landing, Davos finds Gendry and takes him back to Dragonstone. With the Citadel ignoring Maester Wolkan\'s warning letter, Samwell, frustrated, leaves the Citadel with Gilly and Little Sam, taking several restricted books with him. At Winterfell, Littlefinger, knowing Arya is spying on him, lures her into finding the letter that Sansa was forced to write as a hostage in King\'s Landing. Jon, Jorah, and Gendry take Clegane, Thoros, Beric, Tormund and a group of the Free Folk from Eastwatch North beyond the Wall to capture a wight.'),(7,6,66,'Beyond the Wall',70,'Alan Taylor','David Benioff, D. B. Weiss','20-Aug-2017',10.24,'Ramin Djawadi','Jonathan Freeman','Tim Porter',9,84,4.9,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','At Winterfell, Littlefinger schemes to isolate Sansa. Tensions between Arya and Sansa increase after Arya discovers the letter Sansa was forced to write, begging for Robb\'s fealty to Joffrey. Sansa, in turn, finds Arya\'s collection of faces from Braavos. At Dragonstone, Tyrion counsels Daenerys about the upcoming negotiations with Cersei. Beyond the Wall, Jon and the men hunt for a wight to prove the White Walkers\' existence. After capturing one, the group is beset by the White Walker army but not before Jon sends Gendry to Eastwatch to dispatch a raven to Daenerys requesting help. During the night, an injured Thoros freezes to death. As the wight army is about to overwhelm Jon\'s group, Daenerys arrives with her dragons, destroying many wights. The Night King, the White Walkers\' leader, kills Viserion, one of Daenerys\' dragons, with an ice spear. Daenerys flies off with the men, but is unable to rescue Jon. Benjen Stark intervenes and sacrifices himself to save Jon. When Jon and Daenerys are reunited, Jon pledges himself and the North to Daenerys as Queen. The Night King reanimates Viserion, making the dragon a part of his army.'),(7,7,67,'The Dragon and the Wolf',79,'Jeremy Podeswa','David Benioff, D. B. Weiss','27-Aug-2017',12.07,'Ramin Djawadi','Gregory Middleton','Crispin Green',9.4,88,6,'April 21, 2016','August 2016 – February 2017','Outline from A Dream of Spring and original content','The wight is presented to the Lannister court. Cersei demands Jon\'s neutrality, but she storms off when Jon upholds his oath to Daenerys. Tyrion meets with Cersei, apparently gaining her alliance. Cersei reveals to Jaime that she instead will use the Golden Company of Braavos to secure her hold on Westeros and allow the white walkers to destroy Daenerys and Jon\'s armies. Disgusted, Jaime rides north to warn Jon and Daenerys. At Dragonstone, Theon wins his men\'s respect and leads them to rescue Yara. Aboard a North-bound ship, Jon seeks out Daenerys, and they become lovers. At Winterfell, Littlefinger works to increase dissent between Arya and Sansa. Sansa, Arya, and Bran publicly accuse Littlefinger of murdering Jon and Lysa Arryn and of treason against their father. Deserted by the Lords of the Vale, Littlefinger is executed by Arya. Samwell arrives and meets with Bran. Combining Gilly\'s earlier information and Bran\'s vision, they realize Jon is Aegon Targaryen, the legitimate heir to the Iron Throne. Jon\'s parents, Rhaegar Targaryen and Lyanna Stark, secretly married. At Eastwatch, the Night King, astride the undead Viserion, blasts a hole through the Wall with blue dragon fire; the Army of the Dead marches through.'),(8,1,68,'Winterfell',53,'David Nutter','Dave Hill','14-Apr-2019',11.76,'Ramin Djawadi','David Franco','Crispin Green',7.6,92,5.5,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','Upon reaching Winterfell with their combined armies, Jon and Daenerys learn the Army of the Dead has breached the Wall and the Night King commands the undead Viserion. The Northern Houses and the Vale rally around Winterfell but distrust Daenerys and doubt Cersei\'s pledge to send troops. Euron returns to King\'s Landing with the Golden Company and entices Cersei to consummate their union. Cersei, through Qyburn, hires Bronn to assassinate Tyrion and Jaime. Theon rescues Yara, who then sets out to retake the Iron Islands, while Theon returns to Winterfell. There, Jon is reunited with Arya. Jon and Daenerys ride the dragons and deepen their bond. Daenerys wants to reward Sam for saving Jorah before realizing that she executed his father and brother. Sam tells Jon that he was born Aegon Targaryen and is the true heir to the Iron Throne. At House Umber, Tormund and Beric encounter Edd and other Night\'s Watch members. They find the castle\'s occupants dead, and the wight of Ned Umber is left as a gruesome message. Jaime arrives at Winterfell where Bran awaits him.'),(8,2,69,'A Knight of the Seven Kingdoms',57,'David Nutter','Bryan Cogman','21-Apr-2019',10.29,'Ramin Djawadi','David Franco','Crispin Green',7.9,87,5.9,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','Jaime reveals Cersei\'s deception to the Targaryen-Stark alliance and joins them after Brienne vouches for his honor. Jaime apologizes to Bran for crippling him; Bran replies he harbors no anger and says they are no longer the same people. Daenerys no longer trusts Tyrion\'s judgment for his having believed Cersei, but Jorah asks that she forgive Tyrion\'s mistakes. Citing their mutual love for Jon, Daenerys tries to gain Sansa\'s trust, but Sansa says the North vowed never to bow to anyone again. Theon, Edd, Tormund, and Beric arrive at Winterfell, with the latter three reporting the undead army\'s impending arrival. Bran proposes he lure out the Night King, who intends to destroy the Three-Eyed Raven. Theon and the Ironborn will protect Bran. Arya seduces Gendry, wanting to experience it before they die. Jaime formally anoints Brienne as a knight. Jorah fails to dissuade Lyanna Mormont from fighting, and Sam presents Jorah with House Tarly\'s ancestral sword. As the Army of the Dead approaches, Jon reveals his true lineage to Daenerys, who realizes that he has a claim to the Iron Throne.'),(8,3,70,'The Long Night',81,'Miguel Sapochnik','David Benioff, D. B. Weiss','28-Apr-2019',12.02,'Ramin Djawadi','Fabian Wagner','Tim Porter',7.5,74,4.2,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','The living meet the Army of the Dead outside Winterfell. The initial Dothraki charge is destroyed and the Unsullied are quickly overwhelmed, despite the dragonfire. Edd is killed saving Sam and survivors retreat into the castle. Melisandre ignites the fire trench surrounding Winterfell to delay the advancing horde. Jon and Daenerys aerially engage the Night King on their dragons. The wights invade Winterfell, overpowering the defenders; Lyanna Mormont is killed destroying a giant wight; Beric dies defending Arya and Melisandre tells Arya what she must do. Jon and Rhaegal knock the Night King off Viserion and Daenerys and Drogon burn him with dragonfire without any effect. The Night King raises the slain Winterfell soldiers and the dead entombed in the Stark family crypt, who attack those sheltered there. Wights pull Daenerys from Drogon and Jorah is fatally wounded defending her. The Night King kills Theon as he protects Bran. Arya ambushes and stabs the Night King with her Valyrian steel dagger shattering him and his White Walkers and Viserion and all wights. Her purpose served; Melisandre allows herself to die of old age.'),(8,4,71,'The Last of the Starks',77,'David Nutter','David Benioff, D. B. Weiss','5-May-2019',11.8,'Ramin Djawadi','David Franco','Katie Weiland',5.5,58,2.9,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','The survivors mourn, burn the dead and then celebrate their victory. During the somber feast, Daenerys uplifts the mood by legitimizing Gendry as a Baratheon, naming him Lord of Storm\'s End. Arya gently declines Gendry\'s subsequent marriage proposal while Jaime and Brienne become lovers. To protect her claim to the throne, Daenerys asks Jon to conceal his true parentage. Bronn arrives and threatens Jaime and Tyrion but spares them in exchange for being promised Highgarden castle. Jon reveals his true parentage to Sansa, Bran, and Arya, swearing them to secrecy. Wanting Jon as king, Sansa tells Tyrion, who informs Varys. Arya and the Hound head for King\'s Landing, separately bent on revenge. Tormund returns north with the Wildlings, taking Ghost at Jon\'s request. Daenerys and her fleet set sail for King\'s Landing, while Jon leads the Northern army. At Dragonstone, Euron\'s navy ambushes Daenerys\' fleet, killing Rhaegal with ship-mounted ballistas. Missandei is taken hostage and Daenerys considers seizing King\'s Landing using dragonfire. Varys and Tyrion debate whether Jon would be a better ruler than Daenerys. Jaime leaves Winterfell to return to Cersei, despite Brienne\'s pleas to stay. Cersei rejects Daenerys\' demand to surrender and has Missandei beheaded before an enraged Daenerys and Grey Worm.'),(8,5,72,'The Bells',77,'Miguel Sapochnik','David Benioff, D. B. Weiss','12-May-2019',12.48,'Ramin Djawadi','Fabian Wagner','Tim Porter',6,49,3.4,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','Varys urges Jon to advance his claim to the throne but Jon refuses to betray Daenerys. After Tyrion reveals Varys\' plot, Daenerys executes Varys by dragon-fire. Jaime is captured but Tyrion releases him so Jaime can persuade Cersei to surrender the city and then escape Westeros together. Jaime, Arya and the Hound each infiltrate King\'s Landing. Riding Drogon, Daenerys destroys the Iron Fleet and most of the city\'s defenses, allowing her army to enter. Cersei\'s forces are quickly overwhelmed and the city signals its surrender. An enraged Daenerys begins leveling the city, burning soldiers and civilians. The allied army follows her lead, slaughtering anyone in their path, horrifying Tyrion and Jon. Jaime kills Euron but is mortally wounded. The Hound convinces Arya to abandon her vendetta against Cersei and save herself; then he confronts the Mountain. The brothers, battling each other, ultimately perish after falling from a tower into flames. Cersei and Jaime reunite but are killed as the Red Keep collapses on them. Jon calls for a retreat as frantic civilians flee the devastation. Arya barely escapes alive.'),(8,6,73,'The Iron Throne',78,'David Benioff & D. B. Weiss','David Benioff, D. B. Weiss','19-May-2019',13.61,'Ramin Djawadi','Jonathan Freeman','Katie Weiland',4,47,2.6,'July 30, 2016','October 2017 – July 2018','Outline from A Dream of Spring and original content','Jon is appalled when the Unsullied execute captured soldiers upon Daenerys\' orders. Tyrion finds Jaime and Cersei dead in the ruins. Daenerys rallies the Unsullied and Dothraki, proclaiming she will lead them to \"liberate\" the entire world. Tyrion resigns as Hand of the Queen and is imprisoned for treason. Arya and Tyrion separately warn Jon that Daenerys is a threat to him, House Stark and the people. Jon confronts Daenerys. Unable to halt her destructive path, an agonized Jon kills her. Drogon, enraged, melts the Iron Throne, then carries away Daenerys\' body. Later, Tyrion proposes that all future monarchs be chosen by Westerosi leaders, rather than familial succession. Bran Stark is proclaimed King Bran the Broken. He grants the North independence as a kingdom and appoints Tyrion his Hand. Jon is sentenced to the Night\'s Watch to appease the Unsullied, who set sail for Naath, Missandei\'s homeland. Tyrion reorganizes the Small Council – Brienne, Bronn, Davos and Sam – to rebuild King\'s Landing. Podrick is knighted. Sansa is crowned Queen in the North. Arya sets sail to explore unknown lands west of Westeros. Jon rejoins Tormund and Ghost at Castle Black, leading the Wildlings north of the Wall.');
